import React from "react";

export const Footer = () => {
  return (
    <footer>
      <div>
        <link
          href="//db.onlinewebfonts.com/c/a163d087c4bfdff182eb1b4fcc595798?family=Sansation"
          rel="stylesheet"
          type="text/css"
        />
        <p className="text-4xl ... font-sansa ... font-bold">
          Совет Старшеклассников
        </p>
      </div>
      <div></div>
    </footer>
  );
};
